import React from "react";
import Game from "./Game/Game";
import s from "./Shop.module.css";

const Shop = (props) => {
  let state = props.shopPage;

  let gamesElements = [
    state.games.map((g) => (
      <Game
        name={g.gameName}
        photo={g.gamePhoto}
        developer={g.developer}
        price={g.gamePrice}
      />
    )),
  ];

  return (
    <div className={s.shopContent}>
      <div className={s.variant}>
      <NavLink to="/shop" activeClassName={s.activeLink}>
            Shop
          </NavLink>
        <div className={s.view}>View</div>
        <div className={s.search}>Search</div>
      </div>
      <div>{gamesElements}</div>
    </div>
  );
};

export default Shop;
